-- Create Table "Users"

create table Users (
	UserID INT AUTO_INCREMENT PRIMARY KEY,
	Username VARCHAR(50),
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	DateOfBirth DATE,
	Password VARCHAR(50),
	DateAdded TIMESTAMP
);


-- Create table "Friends"

create table Friends (
	FriendID INT AUTO_INCREMENT PRIMARY KEY,
	FriendWhoAdded INT,
	FriendBeingAdded INT,
	IsAccepted BOOLEAN,
	DateOfBirth TIMESTAMP
);

-- Create Table "Groups"

create table Groups (
	GroupID INT AUTO_INCREMENT PRIMARY KEY,
	GroupName VARCHAR(50),
	CreatedBy INT,
	DateAdded TIMESTAMP
);

-- Create Table "Posts"

create table Posts (
	PostID INT AUTO_INCREMENT PRIMARY KEY,
	PostDescription TEXT,
	PostedBy INT,
	IsPublic BOOLEAN,
	IsOnlyForFriends BOOLEAN,
	GroupID INT,
	DatePosted TIMESTAMP
);

-- Create Table "GroupMembershipRequests"

create table GroupMembershipRequests (
	GroupMemberShipRequestsID INT AUTO_INCREMENT PRIMARY KEY,
	GroupID  INT,
	GroupMemberUserID INT,
	IsGroupMemberShipAccepted BOOLEAN,
	DateAccepted TIMESTAMP
);
